import "./App.css";
import React, { useEffect, useState } from "react";

//define the mock data with keys
const courses = [
  {
    id: 0,
    name: "Full Stack Developement Program",
    price: "₹89,999",
    category: "Software Development",
  },
  {
    id: 1,
    name: "Python Automation Testing Program",
    price: "₹64,999",
    category: "Testing",
  },
  {
    id: 2,
    name: "UI/UX Program",
    price: "₹89,999",
    category: "Design",
  },
];

function App() {
  const [data, setData] = useState([]);

  const fetchData = () => {
    return fetch("https://jsonplaceholder.typicode.com/users")
      .then((res) => res.json())
      .then((d) => setData(d));
  };

  useEffect(() => {
    fetchData();
  }, []);

  return (
    <div className="container">
      <div>
        <h1>Searching </h1>
      </div>
      <center>
        {data.map((dataObj, idx) => {
          return (
            <div className="box">
              <div class="card">
                <div class="category"> {dataObj.username} </div>
                <div class="heading">
                  {dataObj.name}
                <div class="author">
                  {dataObj.email}
                </div>
                </div>
            </div>
            </div>
          );
        })}
      </center>
    </div>
  );
}

export default App;
